import React from 'react';
import styled from 'styled-components';

const GeneralForm = styled.form`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  width: 420px;
  padding: 5px;
  padding-bottom: 0;
  margin-right: 20px;
  margin-bottom: 40px;
`;

export default GeneralForm;
